import React from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { solid } from "@fortawesome/free-solid-svg-icons";
const NavItem = (props) => {
  return (
    <div>
      <FontAwesomeIcon icon={`fa-solid ${props.icon}`}>
        {props.type}
      </FontAwesomeIcon>
    </div>
  );
};

export default NavItem;
